import React, { Component } from 'react';
import Fade from 'react-reveal/Fade';

import bear from './../../../../Assets/art/Logo/Bear.png';
import dino from './../../../../Assets/art/Logo/Dino.png';
import loli from './../../../../Assets/art/Logo/LolipopLogo.png';

import animationDino from './../../../../Assets/art/GIFs/dinodoods.mp4';
class Two extends Component {
    state = {  } 
    render() { 
        return (
            <div className='whole'>

                <Fade><div id = "logos">
                    <p id = "title">Logos</p>
                    <p id = "paragraph">I also provide clients with handrawn logos and concepts</p>
                </div></Fade>

                <div className='logoIcons'>
                <Fade top duration = {1000}> <img className = "col-lg-3" src= {bear} /></Fade>
                <Fade top duration = {1500}> <img className = "col-lg-3" src= {loli} /></Fade>
                <Fade top duration = {2000}> <img className = "col-lg-3" src= {dino} /></Fade>
                </div>


                <div id = "animations">

                    <div id = "animationVid">
                        <video className = "col-lg-7 col-md-5 col-sm-12">
                            <source src = {animationDino}></source>
                        </video>
                    </div>

                </div>
            </div>
        );
    } 
}

export default Two;
